const initialState = {
	next_employee_id: 1,
	employees: [
		{ id: 'Adam Nowak'}
	]
}

const employeesReducer = (state = initialState, action) => {
	switch (action.type) {
		default:
			return state;
	}
};

export default employeesReducer;
